[Briefing] 
0=Tour 04-3@Operation: Grinder@Location: Black Forest, 
1=Germany@--------------------------------------------------@@Captain, 
2=your situation is percarious. The Soviets have tracked your transport 
3=and have sent aircraft to eliminate you! You must drop behind enemy 
4=lines and proceed to friendly territory on foot. @@There is no safe 
5=route from your position to the nearest Allied base. The Allies have 
6=sent an Agent to guide you to position, where the Allies punch a hole 
7=in the Soviet line to facilitate your escape. @@Hurry up, there is 
8=not much time to lose! 

[Tutorial] 
1=Make your way to the Allied base south of your position. 
2=Eliminate the main Soviet base in the north-east. 
3=The Chronosphere, Technology Center and Gap Generator must survive. 
4=Agent: "The Allies sent me to assist you. Follow me." 
5=The Allies are assembling to break the Soviet line to allow your escape. 
6=Tesla Coil destroyed. Use this opening for your escape. 
7=Good. You have reached friendly territory. 
8=The Soviets threaten a research facility critical for our war effort. 
9=You are provided with production facilities. Organize a defense with us 
10=and push the Soviets back! 
11=The Soviets have lost their base and are beginning to retreat. Good job. 
12=You have been killed - Mission Failed 
13=The Chronosphere has been destroyed - Mission Failed 
14=The Technology Center has been destroyed - Mission Failed 
15=The Gap Generator has been destroyed - Mission Failed 
16=It is daytime. Normal vision is restored. 
17=It is nighttime. The Gap Generator is restricting vision for all forces. 
18=Agent: "The Allies will breach the Soviet line at this point. You will need to 
19=evade the Hind that is tailing you for the moment." 
20=Agent: "Coast is clear. Follow me." 
21=We have acquired a new weapon that deals effectively against Soviet 
22=armor. Beware that their ammunition explodes violently on critical damage. 

